export default function About() {
  return (
    <Layout style={{background: "linear-gradient(#00bf8f, #001510)"}}>
      <iframe width="420" height="315"
src="https://www.youtube.com/embed?v=IeMw2K9Mlbg">
</iframe>
    </Layout>
  )
}
